import PropTypes from "prop-types";
import "antd/dist/antd.css"; // or 'antd/dist/antd.less'

const App = ({ Component }) => {
  return (
    <>
      <Component />
    </>
  );
};

App.propTypes = {
  Component: PropTypes.elementType.isRequired,
};

export default App;
